import React from 'react'
import './Home.css'

const Home = () => {
	return (
		<>
			<div className='homeContainer' style={{ backgroundImage: `url("./Personal-Site/Images/Home/background3.png")`, backgroundAttachment:'fixed', backgroundSize:'100% 100%' }}>
				<div class='homeCard'>
					<img class='homeCardImg' src='./Personal-Site/Images/Home/me2.jpg'></img>
				</div>
				<div class='homeCard'><img class='homeCardImg' src='./Personal-Site/Images/Home/cheers.jpg'></img></div>
				<div class='homeCard'><img class='homeCardImg' src='./Personal-Site/Images/Home/me1.jpg'></img></div>
				<div class='homeCard'><img class='homeCardImg' src='./Personal-Site/Images/Home/boats.jpg'></img></div>
			</div>
		</>
	)
}

